// import React, { useState, useEffect } from 'react';


export default function Popup(props) {
    const { onSelect } = props;

    const handleChange = () => {
        onSelect();
        alert('location.hostname');
    }

    return (
        <div>
            <button className="nav-item" onClick={() => handleChange()}>
                Hi, my name is Long
            </button>
        </div>
    );
}
